import { useState, useEffect } from 'react';
import { calculateWindAdjustment } from '../utils/windModifications';

function CompetitionTable({ points, eventType }) {
  const [windSpeed, setWindSpeed] = useState('');
  const [adjustedPoints, setAdjustedPoints] = useState(points);

  const WIND_AFFECTED_EVENTS = ['100m', '200m', '100mH', '110mH', 'LJ', 'TJ'];
  const needsWindInput = (event) => WIND_AFFECTED_EVENTS.includes(event);

  useEffect(() => {
    if (needsWindInput(eventType) && windSpeed && points) {
      const windAdjustment = calculateWindAdjustment(
        eventType,
        parseFloat(windSpeed),
        points
      );
      setAdjustedPoints(Math.round(points + windAdjustment));
    } else {
      setAdjustedPoints(points);
    }
  }, [points, windSpeed, eventType]);

  const competitionLevels = [
    "OW (Olympic Games/World Championships)",
    "GL (Diamond League Final)",
    "GW (Diamond League)",
    "A (Continental Championships)",
    "B (Area Permit/Classic Meetings)",
    "C (National Championships)",
    "D (National Permit Meetings)",
    "E (Other Competitions)"
  ];

  return (
    <div className="world-ranking-section">
      <h2>World Ranking Points Calculator</h2>

      {needsWindInput(eventType) && (
        <>
          <div className="wind-info-box">
            <h3>Wind Modification Information</h3>
            <p>
              In order to establish a valid ranking, wind-aided results are included in the ranking. 
              However, as adverse winds also influence the results, the Rankings also take headwinds into account.
            </p>
            <p>The wind modification applies in the following events:</p>
            <ul>
              <li>100m</li>
              <li>200m</li>
              <li>100m Hurdles</li>
              <li>110m Hurdles</li>
              <li>Long Jump</li>
              <li>Triple Jump</li>
            </ul>
            <p>
              Wind Modification System modifies the Result Scores depending on both the strength and direction 
              of the wind:
            </p>
            <ul>
              <li>Headwind: adds points to the Result Score</li>
              <li>Tail wind: deducts points from the Result Score</li>
              <li>No modification between 0 m/s and +2.0 m/s</li>
              <li>For tail wind, deduction starts from +2.1 m/s</li>
              <li>±0.6 points for every ±0.1 m/s</li>
              <li>No wind information (NWI): -30 points deduction</li>
            </ul>
          </div>

          <div className="wind-input-section">
            <label>Wind Speed (m/s):</label>
            <input
              type="number"
              step="0.1"
              value={windSpeed}
              onChange={(e) => setWindSpeed(e.target.value)}
              placeholder="Enter wind speed (+/-)"
            />
            <div className="wind-info">
              + for tailwind, - for headwind
            </div>
            {windSpeed && adjustedPoints !== points && (
              <div className="wind-adjustment-info">
                Base Points: {points}
                <br />
                Wind Adjusted: {adjustedPoints} 
                ({windSpeed > 0 ? '-' : '+'}{Math.abs(adjustedPoints - points)} points)
              </div>
            )}
          </div>
        </>
      )}

      <div className="competition-levels">
        {competitionLevels.map((level) => (
          <div key={level} className="competition-category">
            <h3>{level}</h3>
            <div className="points-value">
              {adjustedPoints ? adjustedPoints : '-'} points
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default CompetitionTable;
